import React, { Component } from "react";
import AppBar from "@material-ui/core/AppBar";
import Toolbar from "@material-ui/core/Toolbar";
import ShoppingCartIcon from "@material-ui/icons/ShoppingCart";
import LocationOnIcon from "@material-ui/icons/LocationOn";
import SearchIcon from "@material-ui/icons/Search";
import AccountCircleIcon from "@material-ui/icons/AccountCircle";

const styles = {
  navBar: {
    textAlign: "center",
    // marginLeft: "auto",
    // marginRight: "auto",
    // border: "1px black solid"
  },
  actions: {
    float: "right",
    border: "1px black solid"
  },
};

export default class NavBar extends Component {
  render() {
    return (
      <div id="Nav-Bar">
        <AppBar position="static">
          <Toolbar >
            <div id="title" style={styles.navBar}>
              <h2>E-Commerce Solutions</h2>
            </div>
            <div id="actions" styles={styles.actions}>
              <span id="locationIcon" style={styles.icon}>
                <LocationOnIcon />
              </span>
              <span id="searchIcon" style={styles.icon}>
                <SearchIcon />
              </span>
              <span id="shoppingCartIcon" style={styles.icon}>
                <ShoppingCartIcon />
              </span>
              <span id="accountIcon" style={styles.icon}>
                <AccountCircleIcon />
              </span>
            </div>
          </Toolbar>
        </AppBar>
      </div>
    );
  }
}
